import React, { useState, useEffect } from 'react';
import {fetchMembers} from './github_api'


export default function Members(){
    const [members, setMembers] = useState([])
    useEffect(() => {
        fetchMembers().then(
        (m) => {
          setMembers(m);
        })

    }, []);
    return(
        <>
        <ul className = "list-group mt-5 ml-5">
            {members.map((member) => {
                return(
                <li key = {member.url} className="list-group-item d-flex ml-5">
                <div className="p-2 w-25">
                    <img src={member.avatar_url} alt={member.avatar_url} id="thumbnail"></img>
                </div>
                <div className="p-2 mt-4">
                    <button className="btn btn-outline-danger text-dark" value={member.url}>{member.login}</button>
                </div>
              </li>);
            })}
        </ul>
        </>
    );
}
